import React, { useState } from 'react'
import { List} from './List'
import { Myaccordian } from './Myaccordian'
export const Accordian = () => {
  const [item,setItem]= useState(List);
  return (
    <>
    <section>
        {
         
            item.map((curVal)=>{
                return <Myaccordian key={curVal.id}
                 {...curVal} />
            })
        }
        </section>
    </>
  )
}
